INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1103, '汤色清亮，香气高扬，兰花香清正，滋味醇厚甘鲜，回味持久', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1104, '纯净的粽香、木质香、糯香，茶汤细腻稠滑，饮后温暖舒畅', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1105, '香气馥郁有层次，水含香好，入口瞬间充盈口腔，直入喉咙。喉韵深而持久，汤入喉，在喉咙深处立即泛起香甜甘凉并返至口内', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1106, '茶汤柔和，花蜜香', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1107, '香气丰富，留香持久，滋味醇滑，回味持久，品种特征明显。', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1108, '干茶茶条卷曲，肥壮圆结，沉重匀整。干茶颜色砂绿，整体形状似蜻蜓头、螺旋体、青蛙腿。冲泡后，茶叶有天然馥郁的兰花香，滋味醇厚甘鲜，回甘悠久，俗称有“音韵”。铁观音茶香高而持久，可谓“七泡有余香”', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1109, '汤色清亮，香气高扬，兰花香清正，滋味醇厚甘鲜，回味持久', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1110, '好了，知道了霍山黄芽的这些口感滋味，不仅防得了无良茶商忽悠；而且，你在与茶友品茗时也显得多一份格调和韵味啦。', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
