INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1114, '“香不过肉桂”这句俗语，早已流传多年。沏一泡肉桂茶，品的就是它的香气，长期以来，肉桂茶的“香气担当”可谓实至名归。', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
