INSERT INTO citys.messages (id, word, createdAt, updatedAt) VALUES (1116, '再说它的口感，入口稠糯带甜，香气复合度很高，木质香、粽叶香、枣香，纯净而绵长，茶汤细腻顺滑，一口下去，幸福感就涌上来。', '2023-04-17 03:44:31', '2023-04-17 03:44:31');
